import os
import json
import datetime
from flask import Flask, request, jsonify, send_file

app = Flask(__name__)

# Sample validation rules
validation_rules = {
    "name": lambda x: isinstance(x, str) and len(x) > 0,
    "age": lambda x: isinstance(x, int) and 0 < x < 120,
    "email": lambda x: isinstance(x, str) and "@" in x,
}

submissions = []
projects = []
issues = []
user_tests = []
file_cache = {}

def validate_submission(data):
    errors = []
    for field, rule in validation_rules.items():
        if field not in data or not rule(data[field]):
            errors.append(f"Invalid value for {field}: {data.get(field)}")
    return errors

def generate_file_name():
    return f"submission_{datetime.datetime.now().strftime('%Y%m%d%H%M%S')}.json"

def save_submission(data):
    filename = generate_file_name()
    with open(filename, 'w') as f:
        json.dump(data, f)
    return filename

@app.route('/upload', methods=['POST'])
def upload_submission():
    data = request.json
    errors = validate_submission(data)

    if errors:
        return jsonify({"success": False, "errors": errors}), 400

    filename = save_submission(data)
    submissions.append(data)
    return jsonify({"success": True, "file": filename}), 201

@app.route('/projects', methods=['POST'])
def add_project():
    project_data = request.json
    projects.append(project_data)
    return jsonify({"success": True, "project": project_data}), 201

@app.route('/issues', methods=['POST'])
def track_issue():
    issue_data = request.json
    issues.append(issue_data)
    return jsonify({"success": True, "issue": issue_data}), 201

@app.route('/schedule_testing', methods=['POST'])
def schedule_testing():
    testing_data = request.json
    user_tests.append(testing_data)
    return jsonify({"success": True, "session": testing_data}), 201

@app.route('/update_validation', methods=['POST'])
def update_validation():
    new_rules = request.json
    for field, rule in new_rules.items():
        validation_rules[field] = eval(rule)
    return jsonify({"success": True}), 200

@app.route('/download/<filename>', methods=['GET'])
def download_file(filename):
    if filename in file_cache:
        return send_file(file_cache[filename])

    # Logic to fetch file from storage (assuming files are in the current directory)
    if os.path.exists(filename):
        file_cache[filename] = filename
        return send_file(filename)
    return jsonify({"error": "File not found"}), 404

@app.route('/generate_reports', methods=['GET'])
def generate_reports():
    # Generating a simple report based on submissions
    report_filename = "report.json"
    with open(report_filename, 'w') as f:
        json.dump(submissions, f)
    return send_file(report_filename), 200

@app.route('/submit_record', methods=['POST'])
def submit_record():
    record_data = request.json
    submissions.append(record_data)
    return jsonify({"success": True, "record": record_data}), 201

if __name__ == '__main__':
    app.run(debug=True)
